{{Music of Indonesia}}
[[File:Dangdut Silaturahmi Ramadhan Surabaya.JPG|thumb|right|260px|A modern dangdut performance]]

'Dangdut' (pronounced {{IPAc-en|d|ɑː|ŋ|.|'|d|uː|t}}) is a genre of [[Indonesia]]n [[Folk music|folk]] and [[traditional]] [[popular music]] that is partly derived from [[Hindustani Classical Music|Hindustani]], [[Malays (ethnic group)|Malay]], and [[Arabic music|Arabic]] music. Dangdut is a very popular genre in Indonesia because of its melodious instrumentation and vocals. Indonesians dance in somewhat similar to the [[ghoomar]] while listening to dangdut music, but in a much slower version.{{citation needed|date=July 2016}} Dangdut features a [[tabla]] and [[gendang]] beat
